import React, { useState } from 'react';

function About() {
  return (
    <div className='about'>
      <h1 className='text-center'>About Me</h1>

      <img className="webIcon" src="coding.jpg" alt="" />
    </div>
  );
}
function Portfolio() {
  return (
    <div>
      <h2>About Me</h2>
      <p>Hello! My name is Jane Doe and I am a web developer.</p>
    </div>
  );
}

function Contact() {
  return (
    <div>
      <h2>About Me</h2>
      <p>Hello! My name is Jane Doe and I am a web developer.</p>
    </div>
  );
}

function App() {
  const [showAbout, setShowAbout] = useState(false);
const [showPortfolio, setShowPortfolio] = useState(false);
const [showContact, setShowContact] = useState(false);
  const handleAboutClick = () => {
    setShowAbout(!showAbout);
  };
  const handlePortfolioClick = () => {
setShowPortfolio(!showPortfolio);
  };
  const handleContactClick = () => {
    setShowContact(!showContact);
  };

  return (
    <div id="infoCard" class="card">
      <nav class="navbar">
        <form class="container-fluid justify-content-end">
          <button id="btn" class="btn btnAbout" type="button" onClick={handleAboutClick}>
            About
          </button>
          <button id="btn" class=" btn btnPortfolio" type="button" onClick={handlePortfolioClick}>
            Portfolio
          </button>
          <button id="btn" class=" btn btnContact" type="button" onClick={handleContactClick}>
            Contact
          </button>
        </form>
      </nav>
      <div id="root" class="card-body">
        {showAbout && <About />}
        {showPortfolio && <Portfolio />}
        {showContact && <Contact/>}
      </div>
    </div>
  );

}

export default App;
